(972, 'update ', 'Panomatics high end video production does let the viewer escape to somewhere secluded, where a canvas of blue skies and turquoise sea meet, where island paradise is exactly how it always has been imagined. Stunning aerial drone footage does entice the viewer and emphasis the resorts beauty and stunning location. A world of new experiences is laid out to the viewer`s feet. Breathtaking nature meets with&amp;nbsp;high end luxury.&amp;nbsp;Each of Shangri-La&amp;#39;s restaurants is thoughtfully placed to emphasize the hotel&amp;#39;s best views. Eat amid the treetops at Rima, or dive into fresh seafood while watching the waves crash into the cliffs below at Sirena.&amp;nbsp;Shangri-La provides everything required to pamper their guests after spending the day exploring the island and ocean. CHI-The Spa features a wide array of slow, careful treatments based on Chinese and native Philippines healing concepts. Let our stunning video tell the story and immerse into this spectacular experience.&lt;br /&gt;\r\n&amp;nbsp;', 1, '2018-08-23 16:50:05', '172.68.144.120'),
