(1085, 'update ', 'A dream destination NIYAMA Maldives takes extravagance to an outlandish new level of luxury. Its two islands Chill and Play offer everything holiday makers can dream off. To match the spirit of this resort Panomatics captured visually exciting content which could not be better communicated then with our brand new cutting edge 360 video technology. This is a 360 video. Use your mouse, trackpad or arrow buttons to look left, right, up and down. For best VR viewer experience we recommend 360 virtual reality glasses. Safari web browser does not support this format. The 360 video is best experienced on the YouTube mobile app.', 1, '2018-08-24 14:38:40', '172.68.144.192'),
