(1096, 'Add ', '327 | We are delighted to present the high end 360 virtual tour for one of the leading luxury hotels in Phuket. The Hyatt Regency Phuket Resort is terraced up a lush green hill and offers stunning panoramic views of the Andaman Sea. Guest can enjoy spectacular sunsets from the majority of the 199 rooms. Our panoramas do exactly catch these blissful moments especially when viewed in realistic 3DVR mode. Our virtual tours can be viewed on Ipad, Iphone,mobile compatible, laptops, android and easily shared to all social media platforms.', 1, '2018-08-24 14:41:32', '172.68.144.192'),
