(1119, 'Add ', '338 | Experience Panomatics high end cutting edge 360 virtual tour to present Langham Chicago luxury hotel housed in a skyscraper designed by renowned architect Mies van der Rohe. This beautiful property is conveniently located near the Loop, Grant Park, and the glittering Magnificent Mile.&lt;br /&gt;\r\n&lt;br /&gt;\r\nDiscover the perfect blend of convenience and stylish comfort only at The Langham, Chicago perfectly illustrated by Panomatics sharp photography. Strategically placed hot spots take the viewer of the panoramas from exquisite rooms to enticing facilities. All Panomatics virtual tour projects are compatible to run on iPad, mobile, laptop on-line and off-line and perfect to share on social media platforms.', 1, '2018-08-24 14:45:56', '172.68.144.192'),
