(1131, 'Add ', '349 | Enjoy Panomatics latest high end virtual tour of the highest five star luxury resort in the Middle East. This virtual tour features fantastic interactivity which make the photography come to live. Wander through the amazing spacious room under accommodation tab. The interactive floor plan will guide you through the each villa. Enjoy a plunge in the pool and gaze at breath taking views from the villas terraces and balconies. Panomatics new 360 integrated video technology makes activities like rock climbing so real we dare the viewer to try it. But not before taking a lesson in the Fitness Center! All these amazing features are fully mobile compatible and can be enjoyed via Iphone and Ipads, as well as desktop.', 1, '2018-08-24 14:53:26', '172.68.144.192'),
