(1565, 'update ', 'The restaurant&amp;rsquo;s owner is proud to present his Sushi Otaru in Arena 10, Thong Lo. The place offers premium-grade sushi and other delectable Japanese food like sashimi, salad, deep-fried and grilled items, sukiyaki, rice bowls, etc.&lt;br /&gt;\r\n&lt;br /&gt;\r\nTheir quality ingredients are flown in directly from Hokkaido three times a week and Master Chef Shinji Nakamine, 1988-1989 TV Champion&amp;rsquo;s Sushi Winner with over 25 years of sushi experience, is in charge of preparing sushi for clients.&lt;br /&gt;\r\n&lt;br /&gt;\r\nMust-tries are matsu sashimi (a variety of fish) and salmon cheese roll (grilled salmon covered with cheese and lots of roe). Sushi buffet is an interesting option available at Sushi Otaru as well.', 1, '2018-08-28 15:30:10', '172.68.144.144'),
