(2236, 'update ', 'In military world weapon and military equipment is essential to be&amp;nbsp; managed properly, and one of our product Weapon Asset Management System is the perfect solution software to track, manage and to provide report of each asset.&lt;br /&gt;\r\nWe make sure your weapon asset database is accurate, current and complete with teh support of modern scanning hardware such as RFID, secure web-base software and friendly user mobile apps.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;FEATURES :&lt;/strong&gt;\r\n&lt;ol&gt;\r\n &lt;li&gt;Asset movement&lt;/li&gt;\r\n &lt;li&gt;Registration&lt;/li&gt;\r\n &lt;li&gt;Asset audit&lt;/li&gt;\r\n &lt;li&gt;Personal deployment&lt;/li&gt;\r\n &lt;li&gt;Asset maintenance&lt;/li&gt;\r\n &lt;li&gt;Mobile apps forms&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;strong&gt;BENEFIT :&lt;/strong&gt;\r\n\r\n&lt;ol&gt;\r\n &lt;li&gt;Comperhensive management aof weapon issues and receipts per user as well as maintaining service record&lt;/li&gt;\r\n &lt;li&gt;Multiple management and rRFID identification methods&lt;/li&gt;\r\n &lt;li&gt;&amp;nbsp;Autorized user identification via biometrics or RFID ID card&lt;/li&gt;\r\n &lt;li&gt;Significanty reduced delays associated with paperwork at issue and receipt&lt;/li&gt;\r\n &lt;li&gt;Detailed reports, dashboards and alerts to improve visibility&lt;/li&gt;\r\n &lt;li&gt;On-site database updates and service management possible via an easy tu use mobile application&lt;/li&gt;\r\n &lt;li&gt;Complete traceablity&lt;/li&gt;\r\n &lt;li&gt;Manage spare parts, ammunition and other consumables within the armory&lt;/li&gt;\r\n&lt;/ol&gt;', 1, '2018-09-27 01:35:46', '::1'),
