(2294, 'update ', 'About Adhinata Leksana  Wijaya', 1, '2018-09-27 13:51:52', '::1'),
(2295, 'update ', 'Since 2015 Adhinata Leksana Wijaya (ALW) has been a global leading provider of traditional and digital identity solutions, providing advanced safety, identification, and security products and solutions to governments as well as private and public organizations around the world. Adhinata Leksana Wijaya (ALW) has been inspiring governments and national agencies, to design and issue secured multi-ID documents and robust digital identity solutions to its citizen and visitors, using Adhinata Leksana Wijaya (ALW) e-government platforms and innovative solutions for traditional and biometrics enrollment, personalization, issuance, and border control services.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nAdhinata Leksana Wijaya (ALW) has been inspiring the world with its RT location, tracking, monitoring, and verification solutions, empowered by its PureRF&amp;trade; cutting edge wireless hybrids suite of products and technologies, all operated by a secure, proprietary web-based, interactive, user-friendly interface. Adhinata Leksana Wijaya (ALW) features a unique all-in-one field-proven RFID and mobile technology and products, accompanied with advanced complementary services for the healthcare and homecare, security and safety, community public safety, law enforcement, electronic monitoring, livestock monitoring, building and access automation, and more.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nAdhinata Leksana Wijaya (ALW) solution can be customized, and is scalable and highly flexible in order to meet each organization&amp;acute;s unique needs now and in the future. As an industry innovator Adhinata Leksana Wijaya (ALW) continues to develop and incorporate cutting edge technologies into its products and solutions.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nAdhinata Leksana Wijaya (ALW) presents an impressive group of experts in business, commercial, and government identification and wireless technologies, which bring decades of hands-on experience and expertise.', 1, '2018-09-27 13:51:52', '::1'),
